import './index.css'
import { menuData } from './bar'
import { Link } from 'react-router-dom'
import React, { Component } from 'react'

export default class index extends Component {
  state = {
    selectedTab: 'home',
    hidden: false
  }
  changeTab = (tab) => {
    this.setState({ selectedTab: tab })
  }
  render() {
    return (
      <div >
        <ul className="container">
          {/* <li className='nav'>
            Home
        </li>
          <li className='nav'>Mine</li>
          <li className='nav'>Order</li>
          <li className='nav'>Promo</li> */}
          {
            menuData.map(item => (
              <li key={item.key}>
                <Link to={item.path} onClick={this.changeTab.bind(this, item.key)}>

                </Link>
              </li>

            ))
          }
        </ul>
      </div>
    )
  }
}
